  [],\n\t\"revision_timestamp\": \"2016-01-09T16:41:49.797204\",\n\t\"name\": \"archive-of-geosample-data-and-information-from-the-university-of-rhode-island-uri-graduate-scho\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Marine Geological Samples Laboratory
  (MGSL) of the Graduate School of Oceanography (GSO), University of Rhode Islandn
  \              is a partner in the Index to Marine and Lacustrine Geological Samples
  (IMLGS) database, contributing information to the IMLGS n               to help
  researchers discover geological samples curated in their facility.n               The
  partner repository also sends some related data, documents, and imagery to NCEI
  for long-term archive, n               but the originating institution is the definitive
  source of information related to their sample collection. n               The MGSL
  serves as the central repository for dredge rocks, deep-sea cores, grabs and land-based
  geological samples collected n               by the Marine Geology and Geophysics
  group at GSO/URI. The facility is located on the Narragansett Bay Campus of the
  University n               of Rhode Island in Narragansett, R.I. A large part of
  the funding for curatorial activities in the MGSL is obtained from the n               Ocean
  Science Division of the National Science Foundation. The MGSL maintains a large
  collection of marine geological samples\",\n\t\"license_title\": null,\n\t\"extras\":
